id":"1230"},"coordinates":null,"dimension":1,"group":null,"ticker":null},"id":"1233","type":"Grid"},{"attributes":{"num_minor_ticks":5,"tickers":[{"id":"1512"},{"id":"1513"},{"id":"1514"},{"id":"1515"},{"id":"1516"},{"id":"1517"},{"id":"1518"},{"id":"1519"},{"id":"1520"},{"id":"1521"},{"id":"1522"},{"id":"1523"}]},"id":"1227","type":"DatetimeTicker"},{"attributes":{},"id":"1433","type":"AllLabels"},{"attributes":{"axis_label":"Bytes","coordinates":null,"formatter":{"id":"1366"},"group":null,"major_label_policy":{"id":"1482"},"ticker":{"id":"1264"}},"id":"1263","type":"LinearAxis"},{"attributes":{"source":{"id":"1038"}},"id":"1071","type":"CDSView"},{"attributes":{"axis":{"id":"1226"},"coordinates":null,"group":null,"ticker":null},"id":"1229","type":"Grid"},{"attributes":{},"id":"1231","type":"BasicTicker"},{"attributes":{"axis_label":"Percentage","coordinates":null,"formatter":{"id":"1476"},"group":null,"major_label_policy":{"id":"1477"},"ticker":{"id":"1231"}},"id":"1230","type":"LinearAxis"},{"attributes":{},"id":"1255","type":"LinearScale"},{"attributes":{"style":{"border":"1px solid lightgray","box-shadow":"inset 1px 0 8px 0 lightgray","height":"100%","max-height":"1080px","max-width":"1920px","overflow":"auto","padding":"12px","width":"100%"},"text":"\n        &lt;h1&gt; Dask Performance Report &lt;/h1&gt;\n\n        &lt;i&gt; Select different tabs on the top for additional information &lt;/i&gt;\n\n        &lt;h2&gt; Duration: 11991.12 s &lt;/h2&gt;\n        &lt;h2&gt; Tasks Information &lt;/h2&gt;\n        &lt;ul&gt;\n         &lt;li&gt; number of tasks: 7680 &lt;/li&gt;\n         \n&lt;li&gt; compute time: 127357.37 s &lt;/li&gt;\n&lt;li&gt; transfer time: 1.51 s &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Scheduler Information &lt;/h2&gt;\n        &lt;ul&gt;\n          &lt;li&gt; Address: tcp://10.128.0.157:43635 &lt;/li&gt;\n          &lt;li&gt; Workers: 12 &lt;/li&gt;\n          &lt;li&gt; Threads: 12 &lt;/li&gt;\n          &lt;li&gt; Memory: 708.00 GiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2021.10.0 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 2021.10.0 &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\nimport sys\n# e.g. mpirun -np 32 python ~.py\n# NUM_PROCESSES = int(sys.argv[1])  # num of processors\nNUM_POP       = int(sys.argv[1])  # size of population\nNUM_GEN       = int(sys.argv[2])  # num of generations ! in async, it determines # of total birth as num_gen * num_pop\n\n#    This file is part of DEAP.\n#\n#    DEAP is free software: you can redistribute it and/or modify\n#    it under the terms of the GNU Lesser General Public License as\n#    published by the Free Software Foundation, either version 3 of\n#    the License, or (at your option) any later version.\n#\n#    DEAP is distributed in the hope that it will be useful,\n#    but WITHOUT ANY WARRANTY; without even the implied warranty of\n#    MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE. See the\n#    GNU Lesser General Public License for more details.\n#\n#    You should have received a copy of the GNU Lesser General Public\n#    License along with DEAP. If not, see &lt;http://www.gnu.org/licenses/&gt;.\n\nimport array\nimport random\nimport json\nimport subprocess\nimport time, os\n\nimport numpy\n\nimport dask\nfrom dask_mpi import initialize\nfrom dask.distributed import Client, LocalCluster, performance_report\nimport dask.bag as db\nfrom mpi4py import MPI\n# import multiprocessing\n\nfrom math import sqrt\n\nfrom deap import algorithms\nfrom deap import base\nfrom deap import benchmarks\nfrom deap.benchmarks.tools import diversity, convergence, hypervolume\nfrom deap import creator\nfrom deap import tools\n\nimport jupyter_server_proxy\n\ndef dask_map(func, iterable):\n    bag = db.from_sequence(iterable).map(func)\n    return bag.compute()\n\nt_start = time.time()\n\ncreator.create(\"FitnessMulti\", base.Fitness, weights=(-1.0, -1.0))\ncreator.create(\"Individual\", array.array, typecode='d', fitness=creator.FitnessMulti)\n\ntoolbox = base.Toolbox()\n\n# Problem definition\n# Functions zdt1, zdt2, zdt3, zdt6 have bounds [0, 1]\nBOUND_LOW, BOUND_UP = -1.0, 1.0\n\n# Functions zdt4 has bounds x1 = [0, 1], xn = [-5, 5], with n = 2, ..., 10\n# BOUND_LOW, BOUND_UP = [0.0] + [-5.0]*9, [1.0] + [5.0]*9\n\n# Functions zdt1, zdt2, zdt3 have 30 dimensions, zdt4 and zdt6 have 10\nNDIM = 25\n\ndef uniform(low, up, size=None):\n    try:\n        return [random.uniform(a, b) for a, b in zip(low, up)]\n    except TypeError:\n        return [random.uniform(a, b) for a, b in zip([low] * size, [up] * size)]\n\ntoolbox.register(\"attr_float\", uniform, BOUND_LOW, BOUND_UP, NDIM)\ntoolbox.register(\"individual\", tools.initIterate, creator.Individual, toolbox.attr_float)\ntoolbox.register(\"population\", tools.initRepeat, list, toolbox.individual)\n\ndef initPopulation(pcls, ind_init, file):\n    dat = numpy.genfromtxt(file,delimiter=',')\n    return pcls(ind_init(c) for c in dat[:NUM_POP])\n\ntoolbox.register(\"population_guess\", initPopulation, list, creator.Individual, \"init.csv\")\n\ndef evaluate(ind):\n    w = numpy.array([])\n    for x in ind:\n        w = numpy.append(w,[x])\n\n    st = time.time()\n    try:\n        process = subprocess.run([\"./airfoil_exec \"+\" \".join(numpy.char.mod('%.12f', w))], check=True, capture_output=True, text=True, shell=True).stdout\n        f = numpy.array(process.split()).astype(numpy.float64)\n        fitness = [-f[0], -f[1]] # negative signs for minimization\n    except:\n        fitness = [ 0.0 , 0.0  ] # any errorenous situations will be neglected    \n    et = time.time()\n    \n    print('worker: ',f'{os.getpid():06d}',\n          ', evaluated: ', f'{fitness[0]:12.4e}',', ',f'{fitness[1]:12.4e}',\n          ', end: ',f'{et-start:.4f}', ' , start: ',f'{st-start:.4f}')\n#     print(\"evaluated on \" + multiprocessing.current_process().name + \": \",fitness)\n        \n    return fitness\n\ntoolbox.register(\"evaluate\", evaluate)\ntoolbox.register(\"mate\", tools.cxSimulatedBinaryBounded, low=BOUND_LOW, up=BOUND_UP, eta=15.0)\ntoolbox.register(\"mutate\", tools.mutPolynomialBounded, low=BOUND_LOW, up=BOUND_UP, eta=20.0, indpb=1.0/NDIM)\ntoolbox.register(\"select\", tools.selNSGA2)\n\n# Synchronous stuff -----\n# pool = multiprocessing.Pool(processes=NUM_PROCESSES) # CHANGE NUM PROCESSES\ntoolbox.register('map', dask_map)\n# toolbox.register(\"map\", pool.map)\n\ndef recordData(pop, gen):\n    x = numpy.empty([len(pop),NDIM])\n    f = numpy.empty([len(pop),2])\n    itera = 0\n    for ind in pop:\n        x[itera] = numpy.array([val for val in ind])\n        f[itera] = numpy.array(ind.fitness.values)\n        itera += 1\n    numpy.savetxt(fname='./GAdata/Sync_Airf_Gen_'+f'{gen+1:05d}'+'_Population.csv', delimiter=\",\", X=x)\n    numpy.savetxt(fname='./GAdata/Sync_Airf_Gen_'+f'{gen+1:05d}'+'_Score.csv', delimiter=\",\", X=f)\n\ndef main(seed=None):\n    random.seed(seed)\n\n    NGEN = NUM_GEN\n    MU = NUM_POP\n    CXPB = 0.9\n\n    stats = tools.Statistics(lambda ind: ind.fitness.values)\n    # stats.register(\"avg\", numpy.mean, axis=0)\n    # stats.register(\"std\", numpy.std, axis=0)\n    stats.register(\"min\", numpy.min, axis=0)\n    stats.register(\"max\", numpy.max, axis=0)\n\n    logbook = tools.Logbook()\n    logbook.header = \"gen\", \"evals\", \"std\", \"min\", \"avg\", \"max\"\n\n    # pop = toolbox.population(n=MU)\n    pop = toolbox.population_guess()\n    \n    # Evaluate the individuals with an invalid fitness\n    invalid_ind = [ind for ind in pop] # if not ind.fitness.valid]\n    fitnesses = toolbox.map(toolbox.evaluate, invalid_ind)\n    for ind, fit in zip(invalid_ind, fitnesses):\n        ind.fitness.values = fit\n\n    # This is just to assign the crowding distance to the individuals\n    # no actual selection is done\n    # pop = toolbox.select(pop, len(pop))\n\n    # record = stats.compile(pop)\n    # logbook.record(gen=0, evals=len(invalid_ind), **record)\n    # print(logbook.stream)\n\n    recordData(pop, 0)   \n    \n    # Begin the generational process\n    for gen in range(1, NGEN):\n        # Vary the population\n        offspring = toolbox.select(pop, len(pop))\n        offspring = [toolbox.clone(ind) for ind in offspring]\n\n        for ind1, ind2 in zip(offspring[::2], offspring[1::2]):\n            if random.random() &lt;= CXPB:\n                toolbox.mate(ind1, ind2)\n\n            toolbox.mutate(ind1)\n            toolbox.mutate(ind2)\n            del ind1.fitness.values, ind2.fitness.values\n\n        # Evaluate the individuals with an invalid fitness\n        invalid_ind = [ind for ind in offspring] # if not ind.fitness.valid]\n        fitnesses = toolbox.map(toolbox.evaluate, invalid_ind)\n        for ind, fit in zip(invalid_ind, fitnesses):\n            ind.fitness.values = fit\n\n        # Select the next generation population\n        pop = toolbox.select(pop + offspring, MU)\n        # record = stats.compile(pop)\n        # logbook.record(gen=gen, evals=len(invalid_ind), **record)\n        # print(logbook.stream)\n\n        recordData(pop, gen)\n\n    print(\"Final population hypervolume is %f\" % hypervolume(pop, [11.0, 11.0]))\n\n    return pop, logbook\n\nif __name__ == \"__main__\":\n    dask.config.config[\"distributed\"][\"dashboard\"][\"link\"] = \"{JUPYTERHUB_SERVICE_PREFIX}proxy/{host}:{port}/status\"\n    initialize(nthreads=1)\n    # cluster = LocalCluster(dashboard_address=\":0\", threads_per_worker=1)\n    # cluster.scale(NUM_PROCESSES)\n    client = Client()\n    \n    # Wait for stabilization... not sure it's necessary though\n    print(\"WAIT FOR 5 SECONDS...\")\n    time.sleep(5)\n    print(client)\n    print(\"STARTED. Sync\") # , Proc\",f'{MPI.COMM_WORLD.Get_size()-2:03d}',\" Popu \",f'{NUM_POP:06d}',\" Gens \",f'{NUM_GEN:03d}\n\n    # with open(\"pareto_front/zdt1_front.json\") as optimal_front_data:\n    #     optimal_front = json.load(optimal_
